import{_ as e}from"./chunks/material.4996731a.js";import{_ as a}from"./chunks/setter.c638cab4.js";import{_ as r,c as l,o as t,b as i}from"./app.c7c61b90.js";var o="/articles/lowcode1.png",p="/articles/plugin.png";const k='{"title":"\u3010\u4F4E\u4EE3\u7801\u7CFB\u5217\u4E4B\u4E07\u7269\u4E4B\u521D\u3011\u91CD\u751F\u4E4B\u68A6\u56DEDreamweaver\uFF1F","description":"","frontmatter":{"title":"\u3010\u4F4E\u4EE3\u7801\u7CFB\u5217\u4E4B\u4E07\u7269\u4E4B\u521D\u3011\u91CD\u751F\u4E4B\u68A6\u56DEDreamweaver\uFF1F","theme":"default","tag":"InformalEssay","time":"2022.8.2"},"headers":[{"level":2,"title":"\u80CC\u666F","slug":"\u80CC\u666F"},{"level":2,"title":"\u6807\u51C6\u5316\u534F\u8BAE","slug":"\u6807\u51C6\u5316\u534F\u8BAE"},{"level":3,"title":"\u534F\u8BAE\u94FE\u63A5","slug":"\u534F\u8BAE\u94FE\u63A5"},{"level":2,"title":"\u6700\u5C0F\u5185\u6838","slug":"\u6700\u5C0F\u5185\u6838"},{"level":2,"title":"\u6700\u5F3A\u751F\u6001","slug":"\u6700\u5F3A\u751F\u6001"},{"level":2,"title":"\u6700\u540E","slug":"\u6700\u540E"},{"level":2,"title":"\u94FE\u63A5","slug":"\u94FE\u63A5"}],"relativePath":"views/article/InformalEssay/libs/lowcodeDesigner.md"}',n={},s=i('<h2 id="\u80CC\u666F" tabindex="-1">\u80CC\u666F <a class="header-anchor" href="#\u80CC\u666F" aria-hidden="true">#</a></h2><p>\u4E0A\u671F\uFF0C\u7B80\u5355\u4E86\u8BF4\u4E86\u4E00\u4E0B\u4F4E\u4EE3\u7801\u5E73\u53F0\u7684\u73B0\u72B6\u4EE5\u53CA\u8BA4\u8BC6,\u6709\u5C0F\u4F19\u4F34\u8BF4\u8FD9\u4E0D\u5C31\u662F Dreamweaver \u5417\uFF1F\u62D6\u62C9\u62FD\uFF0C\u751F\u6210\u4EE3\u7801\u3002\u53EA\u80FD\u8BF4\u662F\u8FD9\u6837\u4E5F\u4E0D\u662F\u8FD9\u6837\uFF0CDreamweaver \u80FD\u7B97\u4F5C\u53EF\u89C6\u5316\u7F16\u7A0B\u7684\u4E00\u4E2A\u89E3\u51B3\u65B9\u6848\u5427\uFF0C\u4F46\u4E0D\u80FD\u5B8C\u5168\u4EE3\u8868\u4F4E\u4EE3\u7801\u5E73\u53F0\u3002\u7B14\u8005\u5E76\u6CA1\u6709\u4F7F\u7528\u8FC7 Dreamweaver\uFF08\u5165\u624B\u4FBF\u662F vscode\u{1F96D}\uFF09\u3002\u6240\u4EE5\u7F51\u4E0A\u51B2\u6D6A\u4E86\u4E00\u4E0B\u770B\u7F51\u53CB\u7684\u603B\u7ED3 Dreamweaver:</p><ul><li>1.\u751F\u6210\u7684\u4EE3\u7801\u57FA\u672C\u65E0\u6CD5\u7EF4\u62A4\uFF0C\u751F\u6210\u4E00\u5768\u5C4E\uFF0C \u5982\u679C\u4E0B\u4E00\u4E2A\u63A5\u624B\u8FD9\u4E2A\u9879\u76EE\u7684\u4EBA\u4E0D\u7528 DW\uFF0C \u90A3\u4EBA\u5C31\u8499\u5708\u4E86</li><li>2.\u65E0\u6CD5\u4F7F\u7528\u524D\u7AEF\u751F\u6001\uFF0C\u4E0E\u4EC0\u4E48 vue\uFF0CReact \u4E4B\u7C7B\u7684\u6846\u67B6\u6C34\u571F\u4E0D\u670D\uFF0Cnpm \u4F60\u90FD\u4E0D\u597D\u5F15\u5165</li><li>3.\u4E0D\u5229\u4E8E\u5F00\u53D1\u8005\u81EA\u8EAB\u53D1\u5C55\uFF0C\u5BF9\u4EE3\u7801\u7684\u8BA4\u8BC6\u5F88\u975E\u5E38\u6D45\uFF0C\u957F\u671F DW \u4F1A\u5BFC\u81F4\u4E0D\u80FD\u6DF1\u5165\u6280\u672F</li><li>4.\u4E0D\u80FD\u7F16\u5199\u590D\u6742\u7684\u7CFB\u7EDF\uFF0C\u6BD4\u5982\u4E00\u4E9B\u6CA1\u6709 UI \u7684\u7B97\u6CD5\u5E93</li></ul><p>\u8FD9\u57FA\u672C\u4E5F\u662F\u5F00\u53D1\u4F4E\u4EE3\u7801\u5E73\u53F0\u7684\u96BE\u70B9\uFF0C\u8FD9\u4E00\u671F\u6765\u8BF4\u8BF4\uFF0C\u600E\u4E48\u642D\u5EFA\u4E00\u4E2A\u4F4E\u4EE3\u7801\u5E73\u53F0\u5427\u3002\u6D45\u6790\u4E00\u4E0B\u963F\u91CC\u4F4E\u4EE3\u7801\u5F15\u64CE\uFF08 Low-Code Engine\uFF09\u5230\u5E95\u505A\u4E86\u4E9B\u4EC0\u4E48\u3002\u4ED6\u4EEC\u600E\u4E48\u89E3\u51B3\u8FD9\u4E9B\u96BE\u9898\u7684\u3002</p><p><img src="'+o+'" alt=""></p><h2 id="\u6807\u51C6\u5316\u534F\u8BAE" tabindex="-1">\u6807\u51C6\u5316\u534F\u8BAE <a class="header-anchor" href="#\u6807\u51C6\u5316\u534F\u8BAE" aria-hidden="true">#</a></h2><p>\u534F\u8BAE\u5BF9\u4E8E\u5F00\u53D1\u6765\u8BF4\u5E76\u4E0D\u964C\u751F\uFF0C\u6211\u4EEC\u5E38\u89C1\u7684\u4EC0\u4E48 HTTP \u534F\u8BAE\u3001DNS \u534F\u8BAE\u3001TCP/IP \u534F\u8BAE\u7B49\u7B49\uFF0C\u4E00\u4EFD\u4F18\u79C0\u7684\u534F\u8BAE\u80FD\u672A\u540E\u9762\u7701\u53BB\u4E0D\u5C11\u9EBB\u70E6\u3002\u4E5F\u80FD\u89C4\u8303\u591A\u4EBA\u534F\u4F5C\u7684\u6548\u7387\u3002</p><p>\u5728<a href="https://developer.aliyun.com/ebook/read/7507" target="_blank" rel="noopener noreferrer">\u300A\u4F4E\u4EE3\u7801\u5F15\u64CE\u6280\u672F\u767D\u76AE\u4E66\u300B</a>\u4E2D\u4ECB\u7ECD\u4E86\u4EC0\u4E48\u662F\u534F\u8BAE</p><blockquote><p>\u4ECE\u5EFA\u8BBE\u80CC\u666F\u51FA\u53D1\uFF0C\u5171\u5EFA\u5C0F\u7EC4\u660E\u786E\u4E86\u4F4E\u4EE3\u7801\u5F15\u64CE\u7684\u5EFA\u8BBE\u7406\u5FF5\uFF1A\u534F\u8BAE\u5148\u884C\uFF0C\u6700\u5C0F\u5185\u6838\uFF0C\u6700\u5F3A\u751F\u6001\u3002 \u534F\u8BAE\u5148\u884C \u4E00\u4EFD\u5171\u540C\u9075\u5B88\u7684\u534F\u8BAE\u662F\u6574\u4E2A\u4F53\u7CFB\u7684\u57FA\u77F3\uFF0C\u51B3\u5B9A\u4E86\u6574\u4E2A\u4F53\u7CFB\u662F\u5426\u80FD\u591F\u8DB3\u591F\u5305\u5BB9\uFF0C\u517C\u5BB9\u8DB3\u591F\u591A\u7684\u4E0A\u5C42\u573A\u666F\uFF0C\u540C\u65F6\u4E5F\u662F\u6574\u4F53\u6280\u672F\u4F53\u7CFB\u80FD\u5426\u8DB3\u591F\u7A33\u5B9A\u53D1\u5C55\u7684\u57FA\u77F3\uFF0C\u540E\u7EED\u6240\u6709\u7684\u5F15\u64CE\u5B9E\u73B0\u90FD\u662F\u670D\u52A1\u4E8E\u534F\u8BAE\u7684\u3002</p></blockquote><ul><li><p>\u6253\u7834\u7269\u6599\u5B64\u5C9B \u{1F95D}</p></li><li><p>\u4F4E\u4EE3\u7801\u751F\u6001\u7684\u57FA\u7840 \u{1F34C}</p></li><li><p>\u4F4E\u4EE3\u7801\u5F15\u64CE\u5B9E\u73B0\u6807\u51C6 \u{1F349}</p></li></ul><h3 id="\u534F\u8BAE\u94FE\u63A5" tabindex="-1">\u534F\u8BAE\u94FE\u63A5 <a class="header-anchor" href="#\u534F\u8BAE\u94FE\u63A5" aria-hidden="true">#</a></h3><p><a href="https://lowcode-engine.cn/lowcode" target="_blank" rel="noopener noreferrer">\u300A\u4F4E\u4EE3\u7801\u5F15\u64CE\u642D\u5EFA\u534F\u8BAE\u89C4\u8303\u300B</a></p><p><a href="https://lowcode-engine.cn/material" target="_blank" rel="noopener noreferrer">\u300A\u4F4E\u4EE3\u7801\u5F15\u64CE\u7269\u6599\u534F\u8BAE\u89C4\u8303\u300B</a></p><p><a href="https://lowcode-engine.cn/assets" target="_blank" rel="noopener noreferrer">\u300A\u4F4E\u4EE3\u7801\u5F15\u64CE\u8D44\u4EA7\u5305\u534F\u8BAE\u89C4\u8303\u300B</a></p><h2 id="\u6700\u5C0F\u5185\u6838" tabindex="-1">\u6700\u5C0F\u5185\u6838 <a class="header-anchor" href="#\u6700\u5C0F\u5185\u6838" aria-hidden="true">#</a></h2><p>Low-Code Engine \u628A\u4F4E\u4EE3\u7801\u5E73\u53F0\u62C6\u5206\u51FA\u56DB\u4E2A\u6838\u5FC3\u6A21\u5757,\u6DB5\u76D6\u4E86\u4F4E\u4EE3\u7801\u5E73\u53F0\u7684\u6574\u4E2A\u751F\u547D\u5468\u671F\u3002</p><ul><li><p>\u5165\u6599\u6A21\u5757</p><blockquote><p>\u5165\u6599\u80FD\u529B\uFF0C\u8BA9\u7EC4\u4EF6\u5728\u4F4E\u4EE3\u7801\u5E73\u53F0\u4F7F\u7528\u66F4\u5BB9\u6613</p></blockquote></li><li><p>\u7F16\u6392\u6A21\u5757</p><blockquote><p>\u7CBE\u5FC3\u6253\u9020\u7684\u7F16\u6392\u6A21\u5757\uFF0C\u8BA9\u62D6\u62FD\u3001\u914D\u7F6E\u80FD\u529B\u96C6\u6210\u53D8\u5F97\u66F4\u7B80\u5355</p></blockquote></li><li><p>\u6E32\u67D3\u6A21\u5757</p><blockquote><p>\u8FD0\u884C\u65F6\u6E32\u67D3\uFF0C\u5FEB\u901F\u63D0\u4F9B\u534F\u8BAE\u7684\u6E32\u67D3\u80FD\u529B</p></blockquote></li><li><p>\u51FA\u7801\u6A21\u5757</p><blockquote><p>\u51FA\u7801\u80FD\u529B\uFF0C\u63D0\u5347\u4F4E\u4EE3\u7801\u7684\u6269\u5C55\u6027\u548C\u6027\u80FD</p></blockquote></li></ul><h2 id="\u6700\u5F3A\u751F\u6001" tabindex="-1">\u6700\u5F3A\u751F\u6001 <a class="header-anchor" href="#\u6700\u5F3A\u751F\u6001" aria-hidden="true">#</a></h2><ul><li><p>\u7269\u6599\u751F\u6001 \u7269\u6599\u662F\u9875\u9762\u642D\u5EFA\u7684\u539F\u6599\u4E5F\u662F\u4F4E\u4EE3\u7801\u7684\u57FA\u7840</p><p><img src="'+e+'" alt=""></p></li><li><p>\u8BBE\u8BA1\u5668\u751F\u6001 \u8BBE\u8BA1\u5668\u4F18\u5316\u57FA\u7840\u7269\u6599\u7684\u7F16\u6392\u5C5E\u6027</p><p><img src="'+a+'" alt=""></p></li><li><p>\u63D2\u4EF6\u751F\u6001 \u63D2\u4EF6\u529F\u80FD\u8D4B\u4E88\u4F4E\u4EE3\u7801\u5F15\u64CE\u66F4\u9AD8\u7684\u7075\u6D3B\u6027\uFF0C\u4F4E\u4EE3\u7801\u5F15\u64CE\u7684\u751F\u6001\u63D0\u4F9B\u4E86\u4E00\u4E9B\u5B98\u65B9\u7684\u63D2\u4EF6\uFF0C\u4F46\u662F\u65E0\u6CD5\u6EE1\u8DB3\u6240\u6709\u4EBA\u7684\u9700\u6C42\uFF0C\u6240\u4EE5\u63D0\u4F9B\u4E86\u5F3A\u5927\u7684\u63D2\u4EF6\u5B9A\u5236\u529F\u80FD\u3002 \u901A\u8FC7\u5B9A\u5236\u63D2\u4EF6\uFF0C\u5728\u548C\u4F4E\u4EE3\u7801\u5F15\u64CE\u89E3\u8026\u7684\u57FA\u7840\u4E0A\uFF0C\u6211\u4EEC\u53EF\u4EE5\u548C\u5F15\u64CE\u6838\u5FC3\u6A21\u5757\u8FDB\u884C\u4EA4\u4E92\uFF0C\u4ECE\u800C\u6EE1\u8DB3\u591A\u6837\u5316\u7684\u529F\u80FD\u3002\u4E0D\u4EC5\u53EF\u4EE5\u81EA\u5B9A\u4E49\u63D2\u4EF6\u7684 UI\uFF0C\u8FD8\u53EF\u4EE5\u5B9E\u73B0\u4E00\u4E9B\u975E UI \u7684\u903B\u8F91\uFF1A</p><p><img src="'+p+'" alt=""></p></li></ul><h2 id="\u6700\u540E" tabindex="-1">\u6700\u540E <a class="header-anchor" href="#\u6700\u540E" aria-hidden="true">#</a></h2><p>\u770B\u5B8C Low-Code Engine \u7684\u8BBE\u8BA1\uFF0C\u8FD8\u89C9\u5F97\u4F4E\u4EE3\u7801\u5E73\u53F0\u5C31\u662F\u7B80\u5355\u7684\u62D6\u62C9\u62FD\u5417\uFF1F\u4E0B\u671F\u518D\u8BF4\u8BF4\u770B Low-Code Engine \u600E\u4E48\u6253\u901A\u7269\u6599\uFF0C\u6E32\u67D3\u5668\uFF0C\u8BBE\u8BA1\u5668\uFF0C\u600E\u4E48\u4F18\u96C5\u7684\u6570\u636E\u901A\u4FE1\u3002</p><h2 id="\u94FE\u63A5" tabindex="-1">\u94FE\u63A5 <a class="header-anchor" href="#\u94FE\u63A5" aria-hidden="true">#</a></h2><ul><li><a href="https://lowcode-engine.cn/" target="_blank" rel="noopener noreferrer">\u4F4E\u4EE3\u7801\u5F15\u64CE</a></li></ul>',23),c=[s];function d(h,u,_,g,m,f){return t(),l("div",null,c)}var D=r(n,[["render",d]]);export{k as __pageData,D as default};
